import React from "react";
import { Link } from "react-router-dom";
export default function Home() {

	return (
		<div className="div-right"
			>
			<ul>
				<li>
					<Link to="/about-us">
						<img src="about-us.jpeg"  width={300} height={250} align="absmiddle" alt="" />
					</Link>
					<p> Background</p>
				</li>


			</ul>
		</div>
	);
}
